We are asked to solve $27+2x=39$ for $x$.  We subtract 27 from both sides and then multiply both sides by $\frac{1}{2}$: \begin{align*}
27+2x&=39 \\
2x &= 12 \\
x &= \boxed{6}.
\end{align*}

Recall that multiplication and division should be done before addition and subtraction. We get  \begin{align*}
4+10\div2-2\cdot3&=4+5-6\\
&=9-6\\
&=\boxed{3}.
\end{align*}

negative_solution:
Recall that multiplication and division should be done before addition and subtraction. We get
\begin{align*}
4+10\div2-2\cdot3&=4+2-6\\
&=6-6\\
&=\boxed{0}.
\end{align*}

solution:
Notice how the parentheses are only around pairs of numbers that are being multiplied or divided. Since multiplication and division are performed before addition and subtraction, it doesn't matter if we remove the parentheses. That's why  \begin{align*}
&54+(98\div14)+(23\cdot 17)-200-(312\div 6)\\
&=54+98\div14+23\cdot17-200-312\div 6\\
&=\boxed{200}.\end{align*}

