solution:
Since $AB$ is a line segment, $\angle ACD+\angle DCE+\angle ECB=180^\circ$ or $90^\circ + x^\circ + 52^\circ =180^\circ$ or $x^\circ=180^\circ-90^\circ-52^\circ$ or $x=\boxed{38}$.

